window.bookSummaryJSON = "<p><b>The Thieves Guild is renowned for their ability to steal anything.</b></p> <p>Its elite members have robbed nobles of wealth, reputation, and even their honor. The Guildmaster rules them with brutality and fear, yet his name and past are a mystery. From the depths of the Evermist swamp he seeks a master thief, one who can help him reclaim his lost power.</p> <p>Young and brash, Jack Myst has drawn the Guildmaster's attention. His feats mark his potential, but his audacity and cunning make him dangerous. After years of preparation an invitation from the guild is exactly what he desires. When he gets it his hunt begins, and there is nothing he cannot steal.</p> <p>Even the Guildmaster’s secret.</p>"; 
